import React, { Component } from 'react';
import styled from 'styled-components';

const Main = styled.div`
    position: absolute;
    top: 50px;
    left: 1000px;
`;

class Symbol extends Component {
    state = { 
        rect: {
            left:   0,
            top:    0,
            right:  0,
            bottom: 0
        },
        ref: null
    }

    constructor() {
        super();
    }

    HandleMouseDown = (e, target) => {
        console.log(target);
    }

    componentDidMount() {
        console.log(this.state.ref);
    }

    render() {
        return ( 
            <img src={this.props.src} alt="symbol" width="50px" ref={(t) => { this.setState({
                ref: t
            })}} />
        );
    }
}

export default Symbol;
